    'sylius_mollie.onboardingMollie.step_1.title' => 'Let me help you',
    'sylius_mollie.onboardingMollie.step_1.text' => '<p>Thank you for installing Mollie for payment services. This guide will take you through the configuration set-up.</p>',
    'sylius_mollie.onboardingMollie.step_1.btnNext' => 'Start onboarding assistant',
    'sylius_mollie.onboardingMollie.step_1.btnBack' => 'Skip, I know how it works',
    'sylius_mollie.onboardingMollie.step_2.title' => 'Connect to your Mollie account',
    'sylius_mollie.onboardingMollie.step_2.text' => '<p>To sync the Mollie plugin to your webshop you\'ll need Mollie API keys and Profile ID.</p>',
    'sylius_mollie.onboardingMollie.step_2.btnLogin' => 'Log in to my account',
    'sylius_mollie.onboardingMollie.step_2.btnRegister' => 'Create a Mollie account',
    'sylius_mollie.onboardingMollie.step_3.text' => '<p>Now that you\'re connected to Mollie we will configure the environment and credentials.</p> <p>Test will be the default environment in the plugin.</p> <p>You only need to do the configuration once to have TEST + LIVE environments available. Try easily toggling between the two.</p>',
    'sylius_mollie.onboardingMollie.step_4.text' => '<p>Fill in your correct details and click "Test API Keys" this will return a successful or failed result for both the LIVE and TEST environments.</p>',
    'sylius_mollie.onboardingMollie.step_5.text' => '<p>Next, we\'ll set-up key settings for the checkout screen display on your webshop.</p>',
    'sylius_mollie.onboardingMollie.step_6.text' => '<p>Enabling components, allows you to add the fields needed for credit card holder data to your own checkout.</p> <p>If you select NO, users will be redirected to the Mollie checkout page.</p> <p>Learn more about Mollie components <a href="https://www.mollie.com/en/news/post/better-checkout-flows-with-mollie-components" target="_blank">here</a>.</p>',
    'sylius_mollie.onboardingMollie.step_7.text' => '<p>Enabling single click payments remembers your consumer\'s payment preferences in order to expedite follow-up payments. Your consumer does not have to perform any additional actions to enjoy quick and easy payments.</p> <p>Learn more about single click payments <a href="https://help.mollie.com/hc/en-us/articles/115000671249-What-are-single-click-payments-and-how-does-it-work-" target="_blank">here</a>.</p>',
    'sylius_mollie.onboardingMollie.step_8.text' => '<p>Now it\'s time to customize features for individual payment methods.</p> <p>First, select the load methods button. Only the methods that are enabled in your Mollie account will display here.</p> <p>Then you use the enable/disable selector to control which will show on your webshop checkout.</p> <p>Note: It is not possible to continue the guided onboarding without loading payment methods.</p>',
    'sylius_mollie.onboardingMollie.step_9.text' => '<p>For each method, you can enter a custom title here - it will be displayed on your webshop checkout page.</p>',
    'sylius_mollie.onboardingMollie.step_10.text' => '<p>Try uploading a custom image for the payment method icon. This will be shown in the webshop checkout page.</p>',
    'sylius_mollie.onboardingMollie.step_11.text' => '<p>Here you can create filters for country specific payment methods - for example, if you want iDEAL only to show for Netherlands customers you choose "Select Countries" and select Netherlands.</p>',
    'sylius_mollie.onboardingMollie.step_12.text' => '<p>Per method, you can select which Mollie API to use to create payments. Click <a href="https://docs.mollie.com/orders/why-use-orders" target="_blank">here</a> to read about the differences between Orders and Payments API.</p>',
    'sylius_mollie.onboardingMollie.step_13.1.title' => 'Payments API',
    'sylius_mollie.onboardingMollie.step_13.1.text' => '<p>When using Payments API you may want additional details to help you match payments with customer orders -- you can enter those values here but make sure to use the correct tags provided in the text below.</p>',
    'sylius_mollie.onboardingMollie.step_13.2.title' => 'Orders API',
    'sylius_mollie.onboardingMollie.step_13.2.text' => '<p>This is Mollie suggested API to use for webshops because it allows you to create “orders”. An order contains the personal information of a customer (e.g. address) and products that the customer ordered. When an order is made, a corresponding payment will be created automatically.</p>',
    'sylius_mollie.onboardingMollie.step_14.text' => '<p>In case you have fees that you are passing on to the consumer, you can add them here. Read more about fees <a href="https://help.mollie.com/hc/en-us/articles/360012564454-Can-I-pass-over-the-costs-for-the-use-of-a-payment-method-to-my-customers-" target="_blank">here</a>.</p>',
    'sylius_mollie.onboardingMollie.step_15.text' => '<p>Remember to save your configurations.</p>',
    'sylius_mollie.onboardingMollie.step_16.title' => 'You\'re all set!',
    'sylius_mollie.onboardingMollie.step_16.text' => '<p>You can now attempt a customer order on your website.</p>',
